import React, { useState } from 'react';
import "./contact-form.css"
import { FontAwesomeIcon } from "@fortawesome/fontawesome-free";
//import { faAngleDown, faAngleUp } from '@fortawesome/free-solid-svg-icons';

const Items = () => {

  const [customerId, setCustomerId] = useState('');
  const [name, setName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [isExpanded, setIsExpanded] = useState(true);

  const toggleExpansion = () => {
    setIsExpanded(!isExpanded);
  };


  return (
    <div className={`items-container ${isExpanded ? 'expanded' : ''}`}>
    <button className="expand-button" onClick={toggleExpansion}>
      <FontAwesomeIcon icon={isExpanded ? faAngleUp : faAngleDown} />
    </button>

      <div className='input-field'>
      <input type="text" placeholder="Automatic ID" value={customerId} onChange={e => setCustomerId(e.target.value)} />
      </div>

      <div className='input-field'>
      <input type="text" placeholder="Name" value={name} onChange={e => setName(e.target.value)} />
      </div>

      <div className='input-field'>
      <input type="text" placeholder="Phone Number" value={phoneNumber} onChange={e => setPhoneNumber(e.target.value)} />
      </div>
    </div>
  )
};

export default Items;
